$feature["cluster_count"];
var value = $feature["cluster_count"];
var num = Count(Text(Round(value)));
var label = When(
  num < 4, Text(value, "#.#"),
  num == 4, Text(value / Pow(10, 3), "#.0k"),
  num <= 6, Text(value / Pow(10, 3), "#k"),
  num == 7, Text(value / Pow(10, 6), "#.0m"),
  num > 7, Text(value / Pow(10, 6), "#m"),
  Text(value, "#,###")
);
return label;

/**
 * Creates the label text for an SRMP point.
 * - Rounds SRMP to three digits.
 * - Appends an "S" for spurs (RRT = "SP")
 * - Appends a "B" for back mileage
 */
function createSrmpLabel() {
  var label = Text($feature.SRMP, "####.###");

  if ($feature.RelRouteType == "SP") {
    label += Left($feature.RelRouteType, 1)
  }

  if (Upper($feature.AheadBackInd) == "B") {
    label += "B";
  }

  return label;
}

createSrmpLabel();

